import React from 'react';
import './style.css';
import picture1 from './picture1.jpg';

let imageArray = [picture1, picture2.jpg]
function Picture1() {
  return (
      <div class="w3-card-4">
        <img src={imageArray[0]} alt="picture1"></img>
      </div>
  );
}

export default Picture1;
